import React, { Component } from 'react'
import UnlikedIcon from '../../../Icons/UnlikedIcon';
export default class SongInfo extends Component {
  render() {
    return (
      <div className="SongInfo">
        <div className="SongImage">
          <img
            className="SongImage-image"
            src={this.props.song.imageSrc}
            alt={this.props.song.name}
          />
        </div>
        <div className="SongName">
          <div className="SongName-name">
            {this.props.song.name}
            <UnlikedIcon className="Liked" like={this.props.like} />
          </div>
          <div className="SongName-singer">{this.props.song.singer}</div>
        </div>
      </div>
    );
  }
}
